import { createApp } from "vue";
import App from "./App.vue";
import router from "./router";
import './styles.css';
import store from "./store";
import axios from 'axios';

axios.defaults.baseURL = 'http://localhost:8080';


createApp(App)
    .use(store)
    .use(router)
    .mount("#app");
